import React from "react";

import projectTile from "./projectTile.js";

// The project page
const ProjectPage = () => {
  return (
      <div>
        <p>
            A project page
        </p>
        <br/>
        <projectTile title="This is a project tile" />
    </div>
  );
};

export default ProjectPage;
